import '../css/App.css';
import { Route, Routes } from 'react-router-dom';
import Visits from './Visits';
import NewVisits from './NewVisit';

export default function App() {
  return (
    <Routes>
      <Route exact path="./visits" element={<Visits />} />
    </Routes>
  );
}
